  input: TEXT,F3XN,,"The Coca-Cola Company Nonpartisan Committee for Good Government
    (the PAC) recently conducted a review of its financial activities for the past
    several years.  During the review several discrepancies were discovered, which
    discrepancies were brought to the attention of the PAC's FEC reports analyst.  As
    a result, upon the advice of its reports analyst, the PAC amended several reports
    previously filed with the FEC.  After incorporating these adjustments into the
    PAC's balance, there remains a discrepancy between the PAC's balance as reported
    to the FEC and the balance in the PAC's bank account.  Specifically, the balance
    on the PAC's FEC report is $3,092.75 more than the balance in the PAC's bank account.  The
    discrepancy is a result of activity from years ago and cannot be tied to any specific
    transactions.  To reconcile the PAC's FEC balance with its bank balance, therefore,
    an accounting adjustment in the amount of negative $3,092.75 is included in this
    report. "
